export const setDivVisibility = (isVisible) => ({
    type: 'SET_DIV_VISIBILITY',
    payload: isVisible,
  });

  // actions/authActions.js
export const login = () => {
  return {
    type: 'LOGIN',
  };
};

export const logout = () => {
  return {
    type: 'LOGOUT',
  };
};
